import React from 'react';
import { View, Card, CardGrid, Panel, PanelHeader, Group } from '@vkontakte/vkui';



class Settings extends React.Component {
    constructor(props) {
        super(props);
    }
    
    render() {
        return(
            <View activePanel="card">
            <Panel id="card">
              <PanelHeader>CardGrid</PanelHeader>
              <Group separator="hide">
                <CardGrid>
                  <Card size="l">
                    <div style={{ height: 96 }} />
                  </Card>
                  <Card size="m">
                    <div style={{ height: 96 }} />
                  </Card>
                  <Card size="m">
                    <div style={{ height: 96 }} />
                  </Card>
                  <Card size="s">
                    <div style={{ height: 96 }} />
                  </Card>
                  <Card size="s">
                    <div style={{ height: 96 }} />
                  </Card>
                  <Card size="s">
                    <div style={{ height: 96 }} />
                  </Card>
                  <Card size="l">
                    <div style={{ height: 96 }} />
                  </Card>
                </CardGrid>
              </Group>
            </Panel>
          </View>
        );
    }
}

export default settings;
